import React from 'react';
import Header from './components/Header';
import Menu from './components/Menu';
import Content from './components/Content';
import Footer from './components/Footer';
import './App.css';

function App() {
  return (
   <>
    <Header />
    <Menu />
    <Content />
    <Footer />
   </>
  );
}

export default App;
